function initialize(){var e=new google.feeds.Feed("https://github.com/goofiw.atom");e.load(function(e){if(!e.error)for(var t=document.getElementById("github-content"),o=0;o<e.feed.entries.length;o++){var i=e.feed.entries[o],n=document.createElement("div");n.appendChild(document.createTextNode(i.title)),t.appendChild(n)}})}google.load("feeds","1"),google.setOnLoadCallback(initialize);